css:
:root {
  font-size: 16px;
}
.deprecation-cop-status .icon.icon-alert:before {
  width: 17px;
}
.deprecation-cop {
  overflow: auto;
  -webkit-flex: 1;
  background-color: #263238 !important;
}
.deprecation-cop .deprecation-overview:after {
  content: '';
  clear: both;
  display: block;
}
.deprecation-cop .deprecation-info {
  padding: 0 0.5rem;
}
.deprecation-cop .deprecation-info:hover {
  background-color: #607d8b !important;
}
.deprecation-cop .deprecation-detail.list-item {
  white-space: normal;
  clear: both;
}
.deprecation-cop .deprecation-detail.list-item .deprecation-message {
  padding: 5px 0 5px 28px;
  line-height: 1.4;
  font-size: 0.8rem;
}
.deprecation-cop .deprecation-detail.list-item .deprecation-message p:last-child {
  margin-bottom: 0;
}
.deprecation-cop .deprecation-detail.list-item .icon-alert {
  margin-top: 5px;
  float: left;
}
.deprecation-cop .collapsed > ul {
  display: none;
}
.deprecation-cop .list {
  list-style-type: none;
  padding: 0;
}
.deprecation-cop .stack-trace {
  background-color: #263238;
  padding: 0.5rem;
  margin-bottom: 0.5rem;
}
.deprecation-cop a {
  color: rgba(238, 255, 255, 0.6);
}
